import React, { Component } from 'react'
import Overview from './components/Overview';

class App extends Component {
  constructor() {
    super();
  }
  render() {
    return (
      <div>
        <input type='text'></input>
        <input type='submit'></input>
        <Overview />
      </div>
    );
  }
}

export default App;
